import React from 'react';
import { Box, Typography, Paper, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Relatorio() {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem('neofi_auth');
    navigate('/');
  };
  return (
    <Box sx={{ p: 4 }}>
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', mb: 2 }}>
        <Button variant="contained" color="error" onClick={handleLogout}>Sair</Button>
      </Box>
      <Typography variant="h4" color="primary" gutterBottom>Relatório de Operação Imobiliária</Typography>
      <Paper sx={{ p: 3, mb: 2 }}>
        <Typography>Conteúdo do relatório imobiliário aqui...</Typography>
      </Paper>
    </Box>
  );
}

export default Relatorio;
